#################################
# Convert-BinaryToText function
#################################
Function Convert-BinaryToText {
  param
  (
    [Parameter(Mandatory)]
    [string]
    $Path
  )

  $Bytes = [System.IO.File]::ReadAllBytes($Path)
  [System.Convert]::ToBase64String($Bytes)
}
# Convert-BinaryToText D:\temp\create_poster\@none.png | Out-File -FilePath "@none.txt"
# Convert-BinaryToText D:\temp\create_poster\@center-out-fade.png | Out-File -FilePath "@center-out-fade.txt"
# Convert-BinaryToText D:\temp\create_poster\@bottom-up-fade.png | Out-File -FilePath "@bottom-up-fade.txt"
# Convert-BinaryToText D:\temp\create_poster\@top-down-fade.png | Out-File -FilePath "@top-down-fade.txt"
# Convert-BinaryToText D:\temp\create_poster\@bottom-top-fade.png | Out-File -FilePath "@bottom-top-fade.txt"
# exit

#################################
# Convert-TextToBinary function
#################################
Function Convert-TextToBinary {
  param
  (
    [Parameter(Mandatory)]
    [string]
    $Text,
    
    [Parameter(Mandatory)]
    [string]
    $OutputPath
  )

  $Bytes = [System.Convert]::FromBase64String($Text)
  [System.IO.File]::WriteAllBytes($OutputPath, $Bytes)
}

